import React from 'react';

const JobSearch = () => {
    return (
        <div className='cari text-center text-white p-5'>
            <h2>Jelajahi 5000+ pekerjaan baru setiap bulan!</h2>
            <div className="row">
                <div className="col-4">
                    <input class="form-control" type="text" value="" aria-label="readonly input example" placeholder='Cari Lowongan'/>
                </div>
                <div className="col-4">
                <input class="form-control" type="text" value="" aria-label="readonly input example" placeholder='Cari Lowongan'/>

                </div>
                <div className="col-4"></div>
            </div>
        </div>
    );
}

export default JobSearch;
